import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Typography from '@mui/material/Typography';
import HomeIcon from '@mui/icons-material/Home';
import SellIcon from '@mui/icons-material/Sell';
import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';
import InfoIcon from '@mui/icons-material/Info';
import { Link } from 'react-router-dom';
import NavBar from './Navbar';

const drawerWidth = 160;

export default function Sidebardash({ isOpen }) {
    const [sidebarOpen, setSidebarOpen] = useState(false);

    const toggleSidebar = () => {
        setSidebarOpen(!sidebarOpen);
    };
    return (
        <div>
            <NavBar></NavBar>
            <Box sx={{ display: 'flex' }} >
                <Drawer
                    sx={{
                        width: drawerWidth,
                        flexShrink: 0,
                        '& .MuiDrawer-paper': {
                            width: drawerWidth,
                            boxSizing: 'border-box',
                        },
                    }}
                    variant="permanent"
                    // anchor="left"
                    open={isOpen}
                >

                    <Toolbar />
                    <Divider />
                    <List>
                        <ListItem disablePadding component={Link} to={"/"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Dashboard
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/product"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <SellIcon></SellIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Product
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/orders"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <AddShoppingCartIcon></AddShoppingCartIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Orders
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/orders"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <InfoIcon></InfoIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    About Us
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>



                    </List>

                    <br />
                    <Divider />
                    <Typography sx={{ color: 'primary.700' }}>
                        ACCOUNT PAGES
                    </Typography>
                    <List>
                        <ListItem disablePadding component={Link} to={"/profile"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Profile
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/singin"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Sign In
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/signup"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Sign Up
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/logout"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Log Out
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                    </List>
                </Drawer>

            </Box >
        </div>

    );
}
